import React,{Component} from 'react';
import './PageThree.css';

export default class Aboutpage extends Component {

   render(){

       return(

    <div> 
        <img src = {require('./images/03.jpg')}/>

        <p className = "txt">
         Hello,<br></br>
         <br></br>   
         I am Nandana Lekshmi Pillai, a class-1 student at the PRIMUS school, Titz, Germany. <br></br> 
         <br></br>
            I thank you for taking time out to visit my website (a gift from my parents on 
            my fifth birthday).<br></br>
            <br></br>
            Hope you enjoyed it!!!!

            Many thanks,
            Nandana.
        </p>

    </div>


       );
   }

}
